import React, { useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js'; 
import '@fortawesome/fontawesome-free/css/all.min.css';
import './App.css';

// --- DATA SECTION ---
// Keeping data separate makes it easy to update later without touching HTML
const servicesData = [
  {
    icon: "fas fa-camera",
    title: "Portrait Photography",
    desc: "Professional headshots, family portraits, and creative modeling shoots with expert lighting." [cite_start]// [cite: 9-10]
  },
  {
    icon: "fas fa-heart",
    title: "Wedding & Events",
    desc: "Full-day coverage for your special day. Capturing candid moments and cinematic highlights." [cite_start]// [cite: 11-12]
  },
  {
    icon: "fas fa-wand-magic-sparkles",
    title: "Photo Retouching",
    desc: "High-end editing and color grading to bring out the best in every image." [cite_start]// [cite: 13-14]
  }
];

const portfolioImages = [
